import React from 'react';
import './App.css';
import SignupForm from './auth/signup/Signup';
import { StylesProvider } from '@material-ui/core/styles';
import CustomAppBar from './navigation/appBar/AppBar';

function App() {
  return (
    <div className="App">
      <StylesProvider injectFirst>
        <CustomAppBar />
        <SignupForm />
      </StylesProvider>
    </div>
  );
}

export default App;
